import React from "react";

export default function Card(props) {
  return (
    <div className="Place">
      <img src={`${props.item.img}`} className="Place--img"></img>
      <div className="Place--stats">
        <img src="location.jpg" className="loction--logo"></img>
        <p>{props.item.Location}</p>
      </div>
    </div>
  );
}
